import React, { useEffect, useState } from 'react'
import './Addemployee.css'
import Sidebar from './Sidebar'
import Button from './Buttons'
import axios from 'axios';
import { useLocation } from 'react-router-dom';
function Addemployee() {
  const location = useLocation();
  const { data1 } = location.state;
  const [employeeId, setemployeeId] = useState('')
  const [name, setname] = useState('')
  const [fatherName, setfathername] = useState('')
  const [departmentId, setdepartmentId] = useState('')
  const [designation, setdesignation] = useState('')
  const [dob, setdob] = useState('')
  const [gender, setgender] = useState('')
  const [qualification, setqualification] = useState('')
  const [contactNo, setcontactNo] = useState('')
  const [whatsappNo, setwhatsappNo] = useState('')
  const [alternateNo, setalternateNo] = useState('')
  const [officeEmail, setofficeEmail] = useState('')
  const [personalEmail, setpersonalEmail] = useState('')
  const [maritalStatus, setmaritalStatus] = useState('')
  const [blood, setblood] = useState('')
  const [pAddress, setpAddress] = useState('')
  const [pCity, setpCity] = useState('')
  const [pState, setpState] = useState('')
  const [pPincode, setpPincode] = useState('')
  const [pCountry, setpCountry] = useState('')
  const [cAddress, setcAddress] = useState('')
  const [cCity, setcCity] = useState('')
  const [cState, setcState] = useState('')
  const [cPincode, setcPincode] = useState('')
  const [cCountry, setc_country] = useState('')
  const [aadharNo, setaadhar_no] = useState('')
  const [pancardId, setpancard_id] = useState('')
  const [uanNo, setuan_no] = useState('')
  const [bankName, setbank_name] = useState('')
  const [bankAccountNumber, setbank_account_number] = useState('')
  const [ifscCode, setifsc_code] = useState('')
  const [offerDate, setoffer_date] = useState('')
  const [joiningDate, setjoining_date] = useState('')
  const [lastWorkingDate, setlastWorkingDate] = useState('')
  const [emp_type, setemptype] = useState('')
  const [effective_day, seteffectiveday] = useState('')
  const [salary, setsalary] = useState('')
  const [basic, setbasic] = useState('')
  const [hra, sethra] = useState('')
  const [special_allowance, setspecialallowance] = useState('')

  useEffect(() => {
    const sendData = async (data1) => {
      try {
        let response = await axios.post('http://localhost:8000/api/edit-admin', {
          id: data1,
        });
        setname(response.data[0].name);
        setemployeeId(response.data[0].employee_id);
        setfathername(response.data[0].fathers_name);
        setdepartment(response.data[0].department_id);
        setdesignation(response.data[0].designation);
        setdob(response.data[0].dob);
        setgender(response.data[0].gender);
        setqualification(response.data[0].qualification);
        setcontactno(response.data[0].contact_no);
        setwhatsappno(response.data[0].whatsapp_no);
        setalternateno(response.data[0].alternate_no);
        setofficeemail(response.data[0].office_email);
        setpersonalemail(response.data[0].personal_email);
        setmarital_status(response.data[0].marital_status);
        setblood(response.data[0].blood);
        setp_address(response.data[0].p_address);
        setp_city(response.data[0].p_city);
        setp_state(response.data[0].p_state);
        setp_pincode(response.data[0].p_pincode);
        setp_country(response.data[0].p_country);
        setc_address(response.data[0].c_address);
        setc_city(response.data[0].c_city);
        setc_state(response.data[0].c_state);
        setc_pincode(response.data[0].c_pincode);
        setc_country(response.data[0].c_country);
        setaadhar_no(response.data[0].aadhar_no);
        setpancard_id(response.data[0].pancard_id);
        setuan_no(response.data[0].uan_no);
        setbank_name(response.data[0].bank_name);
        setbank_account_number(response.data[0].bank_account_number);
        setifsc_code(response.data[0].ifsc_code);
        setoffer_date(response.data[0].offer_date);
        setjoining_date(response.data[0].joining_date);
        setlast_working_date(response.data[0].last_working_date);
        // setemptype(response.data[1].emp_type);
        // seteffectiveday(response.data[1].effective_day);
        // setsalary(response.data[1].salary);
        // setbasic(response.data[1].basic);
        // sethra(response.data[1].hra);
        // setspecialallowance(response.data[1].special_allowance);
        // console.log(name);
      } catch (error) {
        console.log(error);
      }
    };
    sendData(data1);
  }, [])

  const sendData = async (name, employee_id, fathers_name, department_id, designation, dob, gender, qualification, contact_no, whatsapp_no, alternate_no, office_email, personal_email, marital_status, blood, p_address, p_city, p_state, p_pincode, p_country, c_address, c_city, c_state, c_pincode, c_country, aadhar_no, pancard_id, uan_no, bank_name, bank_account_number, ifsc_code, offer_date, joining_date, last_working_date, emp_type, effective_day, salary, basic, hra, special_allowance) => {
    try {
      const response = await axios.post('http://localhost:8000/api/', {
        name: name,
        employee_id: employee_id,
        fathers_name: fathers_name,
        department_id: department_id,
        designation: designation,
        dob: dob,
        gender: gender,
        qualification: qualification,
        contact_no: contact_no,
        whatsapp_no: whatsapp_no,
        alternate_no: alternate_no,
        office_email: office_email,
        personal_email: personal_email,
        marital_status: marital_status,
        blood: blood,
        p_address: p_address,
        p_city: p_city,
        p_state: p_state,
        p_pincode: p_pincode,
        p_country: p_country,
        c_address: c_address,
        c_city: c_city,
        c_state: c_state,
        c_pincode: c_pincode,
        c_country: c_country,
        aadhar_no: aadhar_no,
        pancard_id: pancard_id,
        uan_no: uan_no,
        bank_name: bank_name,
        bank_account_number: bank_account_number,
        ifsc_code: ifsc_code,
        offer_date: offer_date,
        joining_date: joining_date,
        last_working_date: last_working_date,
        emp_type: emp_type,
        effective_day: effective_day,
        salary: salary,
        basic: basic,
        hra: hra,
        special_allowance: special_allowance,
      });
      alert(response.data.message)
      console.log(response.data.message)
    } catch (error) {
      console.error(error);
    }
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    sendData(name, employee_id, fathers_name, department_id, designation, dob, gender, qualification, contact_no, whatsapp_no, alternate_no, office_email, personal_email, marital_status, blood, p_address, p_city, p_state, p_pincode, p_country, c_address, c_city, c_state, c_pincode, c_country, aadhar_no, pancard_id, uan_no, bank_name, bank_account_number, ifsc_code, offer_date, joining_date, last_working_date, emp_type, effective_day, salary, basic, hra, special_allowance);
  };

  return (
    <div id='main'>
      <Sidebar />
      <div id='employee'>
        <h4>Edit Details</h4>
        <form >
          <div className='detail'>
            <div className='detail1'>
              <div>Employee ID : </div>
              <div>Name : </div>
              <div>Father Name : </div>
              <div>Department : </div>
              <div>Designation : </div>
              <div>Date of Birth : </div>
              <div>Gender : </div>
              <div>Qualification : </div>
              <div>Contact Number : </div>
              <div>Whatsapp Number : </div>
              <div>Alternate Number : </div>
              <div>Office Email : </div>
              <div>Personal Email : </div>
              <div>Marital Status : </div>
              <div>Blood group : </div>
              <div>Permanent Address : </div>
              <div>City : </div>
              <div>State : </div>
              <div>Pincode: </div>
              <div>Country : </div>
              <div>Current Address : </div>
              <div>Current City : </div>
              <div>Current State : </div>
              <div>Current Pincode: </div>
              <div>Current Country : </div>
              <div>Aadhar Card Number : </div>
              <div>Pancard Card Number : </div>
              <div>UAN Number : </div>
              <div>Name of Bank : </div>
              <div>Bank account Number : </div>
              <div>IFSC Code : </div>
              <div>Offer Date : </div>
              <div>Joining Date : </div>
              <div>Last Working Date : </div>
              <div>Employee Type : </div>
              <div>Effective Day : </div>
              <div>Salary : </div>
              <div>Basic Salary : </div>
              <div>HRA Amount : </div>
              <div>Special Allowance :</div>
            </div>
            <div className='detail2'>
              <input type='text' name='id' value={employee_id} disabled></input>
              <input type='text' name='name' value={name} onChange={(event) => { setname(event.target.value) }}></input>
              <input type='text' name='fathers_name' value={fathers_name} onChange={(event) => { setfathername(event.target.value) }}></input>
              <select name='department' value={department_id} onChange={(event) => { setdepartment(event.target.value) }}>
                <option value="">Select</option>
                <option value='01'>01 - Admin</option>
              </select>
              <select name='designation' value={designation} onChange={(event) => { setdesignation(event.target.value) }}>
                <option value="director ceo">Director / CEO</option>
                <option value="director md" selected>Director / MD</option>
                <option value="hr">HR</option>
                <option value="hr manager">HR Manager</option>
              </select>
              <input type="date" name='birth_date' value={dob} onChange={(event) => { setdob(event.target.value) }}></input>
              <select name='gender' value={gender} onChange={(event) => { setgender(event.target.value) }}>
                <option value="">Select</option>
                <option value="Male">Male</option>
                <option value="Female">Female</option>
              </select>
              <input type='text' name='qualification' value={qualification} onChange={(event) => { setqualification(event.target.value) }}></input>
              <input type='number' name='c_no' value={contact_no} onChange={(event) => { setcontactno(event.target.value) }}></input>
              <input type='number' name='w_no' value={whatsapp_no} onChange={(event) => { setwhatsappno(event.target.value) }}></input>
              <input type='number' name='a_no' value={alternate_no} onChange={(event) => { setalternateno(event.target.value) }}></input>
              <input type='email' name='o_email' value={office_email} disabled onChange={(event) => { setoffer_date(event.target.value) }}></input>
              <input type='email' name='p_email' value={personal_email} onChange={(event) => { setpersonalemail(event.target.value) }}></input>
              <select name='martial_status' value={marital_status} onChange={(event) => { setmarital_status(event.target.value) }}>
                <option value="">Select</option>
                <option value="Single">Single</option>
                <option value="Married">Married</option>
              </select>
              <select name='blood_group' value={blood} onChange={(event) => { setblood(event.target.value) }}>
                <option value="">Select</option>
                <option value="A+">A+</option>
                <option value="A-">A-</option>
                <option value="B+">B+</option>
                <option value="B-">B-</option>
                <option value="O+">O+</option>
                <option value="O-">O-</option>
                <option value="AB+">AB+</option>
                <option value="AB-">AB-</option>
              </select>
              <input type='text' name='p_address' value={p_address} onChange={(event) => { setp_address(event.target.value) }}></input>
              <input type='text' name='p_city' value={p_city} onChange={(event) => { setp_city(event.target.value) }}></input>
              <input type='text' name='p_state' value={p_state} onChange={(event) => { setp_state(event.target.value) }}></input>
              <input type='number' name='p_pincode' value={p_pincode} onChange={(event) => { setp_pincode(event.target.value) }}></input>
              <input type='text' name='p_country' value={p_country} onChange={(event) => { setp_country(event.target.value) }}></input>
              <input type='text' name='c_address' value={c_address} onChange={(event) => { setc_address(event.target.value) }}></input>
              <input type='text' name='c_city' value={c_city} onChange={(event) => { setc_city(event.target.value) }}></input>
              <input type='text' name='c_state' value={c_state} onChange={(event) => { setc_state(event.target.value) }}></input>
              <input type='number' name='c_pincode' value={c_pincode} onChange={(event) => { setc_pincode(event.target.value) }}></input>
              <input type='text' name='c_country' value={c_country} onChange={(event) => { setc_country(event.target.value) }}></input>
              <input type='number' name='aadhar_no' value={aadhar_no} onChange={(event) => { setaadhar_no(event.target.value) }}></input>
              <input type='text' name='pancard_no' value={pancard_id} onChange={(event) => { setpancard_id(event.target.value) }}></input>
              <input type='number' name='uan_no' value={uan_no} onChange={(event) => { setuan_no(event.target.value) }}></input>
              <input type='text' name='bank_name' value={bank_name} onChange={(event) => { setbank_name(event.target.value) }}></input>
              <input type='number' name='bank_account_no' value={bank_account_number} onChange={(event) => { setbank_account_number(event.target.value) }}></input>
              <input type='text' name='bank_ifsc_code' value={ifsc_code} onChange={(event) => { setifsc_code(event.target.value) }}></input>
              <input type='date' name='offer_date' value={offer_date} onChange={(event) => { setoffer_date(event.target.value) }}></input>
              <input type='date' name='joining_date' value={joining_date} onChange={(event) => { setjoining_date(event.target.value) }}></input>
              <input type='date' name='last_working_date' value={last_working_date} onChange={(event) => { setlast_working_date(event.target.value) }}></input>
              <select name='employeeType' value={emp_type} onChange={(event) => { setemptype(event.target.value) }}>
                <option value=''>Select</option>
                <option value='ESI'>ESI</option>
                <option value='PF'>PF</option>
                <option value='ESI + PF'>ESI + PF</option>
                <option value='Others'>Others</option>
              </select>
              <input type='date' name='effectiveDay' value={effective_day} onChange={(event) => { seteffectiveday(event.target.value) }}></input>
              <input type='number' name='salary' value={salary} onChange={(event) => { setsalary(event.target.value) }}></input>
              <input type='number' name='basicSalary' value={basic} onChange={(event) => { setbasic(event.target.value) }}></input>
              <input type='number' name='hraAmount' value={hra} onChange={(event) => { sethra(event.target.value) }}></input>
              <input type='number' name='specialAllowance' value={special_allowance} onChange={(event) => { setspecialallowance(event.target.value) }}></input>
            </div>
          </div>
          <div className='buttonemp'>
            <button type='reset'>Reset</button>
            <button type='submit'>Submit</button>
          </div>
        </form>
      </div>
      {/* <Button/> */}
    </div>
  )
}

export default Addemployee
